$x^2 - 10x + y^2 + 6y + c = 0$ എന്ന സമീകരണത്തിന്റെ നിർദ്ദേശാങ്കം
\begin{align*}
&\left(x^2 - 10x + 25\right) + \left(y^2 + 6y + 9\right) + c - 34 = 0 \\
\Rightarrow \quad &\left(x - 5\right)^2 + \left(y + 3\right)^2 = 34 - c
\end{align*}
1 നീളമുള്ള അർദ്ധവ്യാസം ഉണ്ടാകാൻ ആത്മാനം
