Let $\alpha = \arcsin 0.4$ and $\beta = \arcsin 0.5$. Then $\sin \alpha = 0.4$ and $\sin \beta = 0.5$. We have $\cos \alpha = \sqrt{1 - \sin^2 \alpha} = \sqrt{1 - 0.4^2} = \sqrt{0.84}$ and $\cos \beta = \sqrt{1 - \sin^2 \beta} = \sqrt{1 - 0.5^2} = \sqrt{0.75}$. Then \begin{align*}
\sin (\alpha + \beta) \cdot \sin (\alpha - \beta) &= (\sin \alpha \cos \beta + \cos \alpha \sin \beta)(\sin \alpha \cos \beta - \cos \alpha \sin \beta) \\
&= \sin^2 \alpha \cos^2 \beta - \cos^2 \alpha \sin^2 \beta \\
&= 0.4^2 \cdot 0.75 - 0.84 \cdot 0.5^2 \\
&= \boxed{0.03}.
\end{align*}

