\[\angle ABD = \angle ABC - \angle DBC = \frac{180^\circ - \alpha}{2} - \alpha = 90^\circ - \frac{3\alpha}{2}.\]Also, $\angle BDA = 180^\circ - \angle ADB - \angle ABD = 180^\circ - 3\alpha - \left(90^\circ - \frac{3\alpha}{2}\right) = 90^\circ - \frac{3\alpha}{2}.$  Hence, $\angle ABD = \angle BDA,$ so $AB = AD = 10.$

